import React from "react";

export default class GraphDisplay extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            graphName: this.props.fileName,

            test: this.props.random
        }
    }

    render() {
        return(
            <div>{this.state.test}</div>
        );
    }
}
